import React, { useState, useEffect } from 'react';
import { useAuth } from '../../contexts/AuthContext';
import { entService } from '../../services/entService';
import { obstetricsService } from '../../services/obstetricsService';
import toast from 'react-hot-toast';
import { Stethoscope, Baby, Plus, Eye, Calendar, AlertCircle } from 'lucide-react';
import LoadingSpinner from '../common/LoadingSpinner';
import EntSection from './EntSection';
import ObstetricsSection from './ObstetricsSection';

const PatientDashboard = () => {
  const { user } = useAuth();
  const [entCarePlans, setEntCarePlans] = useState([]);
  const [obstetricsCarePlans, setObstetricsCarePlans] = useState([]);
  const [loading, setLoading] = useState(true);
  const [activeSection, setActiveSection] = useState('both');

  useEffect(() => {
    fetchCarePlans();
  }, [user]);

  const fetchCarePlans = async () => {
    try {
      setLoading(true);

      // Fetch ENT care plans for the patient
      const entResponse = await entService.getCarePlansByPatient(user.id);
      if (entResponse.success) {
        setEntCarePlans(entResponse.data);
      }

      // Fetch Obstetrics care plans for the patient
      const obsResponse = await obstetricsService.getCarePlansByPatient(user.id);
      if (obsResponse.success) {
        setObstetricsCarePlans(obsResponse.data);
      }
    } catch (error) {
      toast.error('Failed to load care plans');
      console.error('Error fetching care plans:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleRefresh = () => {
    fetchCarePlans();
    toast.success('Care plans refreshed');
  };

  if (loading) {
    return <LoadingSpinner size="large" text="Loading your care plans..." />;
  }

  return (
    <div className="dashboard-container">
      {/* Dashboard Header */}
      <div className="dashboard-header">
        <h1 className="dashboard-title">Your Care Plans</h1>
        <p className="dashboard-subtitle">
          Welcome back, {user.name}! Here are your current care plans and recovery progress.
        </p>

        {/* Quick Stats */}
        <div className="quick-stats">
          <div className="stat-card">
            <div className="stat-icon ent-icon">
              <Stethoscope size={20} />
            </div>
            <div className="stat-content">
              <div className="stat-number">{entCarePlans.length}</div>
              <div className="stat-label">ENT Care Plans</div>
            </div>
          </div>

          <div className="stat-card">
            <div className="stat-icon obstetrics-icon">
              <Baby size={20} />
            </div>
            <div className="stat-content">
              <div className="stat-number">{obstetricsCarePlans.length}</div>
              <div className="stat-label">Obstetrics Care Plans</div>
            </div>
          </div>

          <div className="stat-card">
            <div className="stat-icon total-icon">
              <Calendar size={20} />
            </div>
            <div className="stat-content">
              <div className="stat-number">{entCarePlans.length + obstetricsCarePlans.length}</div>
              <div className="stat-label">Total Active Plans</div>
            </div>
          </div>
        </div>

        {/* Section Toggle */}
        <div className="section-toggle">
          <button
            className={`toggle-btn ${activeSection === 'both' ? 'active' : ''}`}
            onClick={() => setActiveSection('both')}
          >
            All Care Plans
          </button>
          <button
            className={`toggle-btn ${activeSection === 'ent' ? 'active' : ''}`}
            onClick={() => setActiveSection('ent')}
          >
            <Stethoscope size={16} />
            ENT Only
          </button>
          <button
            className={`toggle-btn ${activeSection === 'obstetrics' ? 'active' : ''}`}
            onClick={() => setActiveSection('obstetrics')}
          >
            <Baby size={16} />
            Obstetrics Only
          </button>
        </div>

        {/* Refresh Button */}
        <button onClick={handleRefresh} className="btn btn-outline refresh-btn">
          <Calendar size={16} />
          Refresh Plans
        </button>
      </div>

      {/* Care Sections - Stacked Vertically */}
      <div className="care-sections">
        {/* ENT Section */}
        {(activeSection === 'both' || activeSection === 'ent') && (
          <div className="care-section">
            <div className="section-header">
              <div className="section-title">
                <div className="section-icon ent-icon">
                  <Stethoscope size={24} />
                </div>
                ENT Care Plans
                <span className="section-count">({entCarePlans.length})</span>
              </div>
            </div>

            <EntSection 
              carePlans={entCarePlans}
              onRefresh={fetchCarePlans}
              isPatientView={true}
            />
          </div>
        )}

        {/* Obstetrics Section */}
        {(activeSection === 'both' || activeSection === 'obstetrics') && (
          <div className="care-section">
            <div className="section-header">
              <div className="section-title">
                <div className="section-icon obstetrics-icon">
                  <Baby size={24} />
                </div>
                Obstetrics Care Plans
                <span className="section-count">({obstetricsCarePlans.length})</span>
              </div>
            </div>

            <ObstetricsSection 
              carePlans={obstetricsCarePlans}
              onRefresh={fetchCarePlans}
              isPatientView={true}
            />
          </div>
        )}

        {/* Empty State */}
        {entCarePlans.length === 0 && obstetricsCarePlans.length === 0 && (
          <div className="empty-state">
            <AlertCircle className="empty-state-icon" />
            <h3 className="empty-state-title">No Care Plans Found</h3>
            <p className="empty-state-description">
              You don't have any active care plans at the moment. 
              Your doctor will create care plans for you as needed.
            </p>
          </div>
        )}
      </div>

      {/* Patient Information Panel */}
      <div className="patient-info-panel">
        <h3>Important Information</h3>
        <div className="info-cards">
          <div className="info-card">
            <Eye size={20} />
            <div>
              <h4>View Only Access</h4>
              <p>You can view your care plans but cannot modify them. Contact your doctor for any changes.</p>
            </div>
          </div>
          <div className="info-card">
            <Calendar size={20} />
            <div>
              <h4>Regular Updates</h4>
              <p>Your care plans are updated regularly by your healthcare team based on your progress.</p>
            </div>
          </div>
          <div className="info-card">
            <AlertCircle size={20} />
            <div>
              <h4>Emergency Contact</h4>
              <p>For urgent medical concerns, contact your doctor immediately or call emergency services.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PatientDashboard;
